import Hero from "./Hero";
import Layout from "./Layout";
import Intro from "./Intro";
import Card2 from "./Card-2";
import Showcase from "./Showcase";
import Nav from "./Nav";
import Foot from "./Foot";

export default function () {
  return (
    <div class="flex flex-col">
      <Nav />
      <Hero />
      <Card2 />
      <Intro />
      <Showcase />
      <Foot />
    </div>
  );
}
